import { Card, CardText, CardHeader, CardBody, Button } from 'reactstrap';
import '../Styles/global.css';

class Index extends Component{
    render(){
      return(
        <div>
        <Header/>
        <a>https://www.youtube.com/watch?v=-MZgtCp8mtc</a>
        </div>
      );
    }

}

  export default Index;
